import React from 'react';
import './TattoosPage.css';

const TattoosPage = () => {
  return (
    <div className="tattoos-page">
      <div className="tattoos-header">
        <div className="macos-window-controls">
          <div className="control red"></div>
          <div className="control yellow"></div>
          <div className="control green"></div>
        </div>
        <div className="macos-title">Tattoos - egirls.faith</div>
      </div>

      <div className="tattoos-content">
        <div className="tattoos-text">
          <h1>Tattoos</h1>
          <p>
            Welcome to the tattoos page. This is where we'll showcase our tattoo designs 
            and body art concepts.
          </p>
          <p>
            More content coming soon.
          </p>
        </div>
      </div>
    </div>
  );
};

export default TattoosPage;
